import React,{useState} from "react";
import Fab from '@mui/material/Fab';
import AddIcon from '@mui/icons-material/Add';
import { InputArea } from "./InputArea";
export const Home=()=>{
    const [inputArea,setInputArea]=useState(false);

    return(
        <div className="homeContainer" style={{position:"relative"}}>
<h1>To Do List</h1>
<InputArea/>
<Fab color="secondary" size="small" aria-label="add" onClick={()=>setInputArea(true)} style={{position:"absolute",bottom:"10px",right:"10px"}}>
  <AddIcon />
</Fab>
        </div>
    )
}
